import React from 'react'
import ContactKeepers from '../layout/ContactKeeper.png'
import Carousel, { Dots, slidesToShowPlugin } from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';
const ContactKeeper = () =>  {


        return (      
            <React.Fragment>
            <div className="container">
            <Carousel
                plugins={[
                    'arrows',
                    'infinite',
                    'fastSwipe'
                ]}
            >
                    <img src={ContactKeepers}/>
                        
                </Carousel>
                <p className ="text-center text-primary">
                This is my first full stack application created for learning the back-end. 
                I used postman for creating my API and use MongoDB to serve as my Cloud Database
                </p>
            </div>
            </React.Fragment>
        )
    }


export default ContactKeeper
